import React from 'react';
import Loading from '../components/UI/loading/loading';

function MainPage({ housedata, loading }) {
  return (
    <div className='mainpage'>
      <div className='filters'>
        <div>FILTERS</div>
        <div className='prices'><label htmlFor='pricemin'>Price starts at:</label>
          <input id='pricemin' min={0}></input>
          <label htmlFor='pricemax'>Price ends at:</label>
          <input id='pricemax'></input></div>
          

          <label htmlFor='spacemin'>Space starts at:</label>
          <input id='spacemin' min={0}></input>
          <label htmlFor='spacemax'>Space ends at:</label>
          <input id='spacemax'></input>
          <label htmlFor='qartertype'>Quarters Type</label>
          <select id='quartertype'>
            <option value='all'>All</option>
            <option value='estate'>Estate</option>
            <option value='hotel'>Hotel Rooms</option>
            <option value='flat'>Flats</option>
          </select>
      </div>
      {loading ? (
        <Loading />
      ) : (
        <div className='houses'>
          {' '}
          {housedata.map((house) => (
            <div key={Date.now()} className='housecard'>
              <img alt={house.title} src={house.picture} />
              <div>
                <h3>{house.title}</h3>
                <p>Price: $ {house.price}</p>
                <p>Size: {house.space} Sqm</p>
                <a href={house.googleurl}>{house.address}</a>
                <p>
                  <span style={{ fontWeight: 'bold' }}>About: </span>
                  {house.desc}
                </p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default MainPage;
